import { Component } from 'react';
import axios from 'axios';

export default class ApiConnect extends Component {

    state = {
        articles: {}
    }


    render() {
        return (

            axios.get('https://jsonplaceholder.typicode.com/todos/1')
                .then(
                    res => {
                        console.log(res.data);
                        this.setState({
                            datos: res.data.articles
                        });
                    }
                )

        );
    }

}
